descr:
Fica a pessoa jurídica supracitada notificada que foi apresentado os documentos atualizados:
1) Controle de pragas (validade agosto de 2025);
2) Limpeza caixa dágua (validade agosto 2025);
3) Laudo de potabilidade da caixa dágua e poços artesianos;
4) Desligamento do idoso Júlio César Teodoro Patrocínio, sendo entregue à família a responsabilidade de seus cuidados;
5) O ART de Ana Paula de Sousa Lima junto ao CRP.
